import { items, ItemsNavbar } from "./items";
import "./styles.css";
export const Navbar = () => {
  return (
    <main className="container">
      <ul className="navbar">
        <li className="nav-items">Navbar</li>
        {items.map((value: ItemsNavbar) => (
          <li className="nav-items" key={value.label}>
            <a className="nav-links">{value.label}</a>
          </li>
        ))}
      </ul>
    </main>
  );
};
